function SvgPathLibs.GetSvgByName(type,name)
    if(not type or not name)then
        return
    end
    local libs = SvgPathLibs[type];
    if(libs)then
        local path_data = libs[name];
        return SvgPathLibs.GetSvgStr(path_data);
    end
end
function SvgPathLibs.GetSvgStr(path_data)
    local s = string.format([[<svg>
  <path d="%s"/>
</svg>
    ]],path_data);
    return s;
end
